import React, {useEffect, useState} from 'react';

import './App.css';

type AppType = {
  id:string
  title:string
  body:string;
}

function App() {

  let [state,setState]=useState<AppType[]>([])
  useEffect(()=>{fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(json => setState(json))},[state])

  const onClickHandler = ()=> {
    setState([])
  }
  return (
    <div className="App">
      <button onClick={onClickHandler}>clear11</button>
      <ul>
        {state.map((el)=>{
          return(
              <li key={el.id}>
                <span>{el.title}</span>
                <span>{el.id}</span></li>
          )
        })}

      </ul>

    </div>
  );
}

export default App;
